insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Estancia Campos De Lino', 'Torrejón del Rey - Guadalajara', 'Chalet independiente en parcela de 600 metros. Divido en 2 plantas sin escaleras son independientes las 2, la parte de arriba con 3 dormitorios muy amplios con armarios empotrados y maleteros grandes, aire acondicionado con bomba cde calor y calefacción por gasoil, ventanas de pvc Climalit 10 y mosquiteras, las puertas son de ancho para minusvalidos, para baño. completo con ventana mosquitera y bañera, cocina completa con mesa y banco 2 ventanas, vitrocerámica de inducción, puerta corredera para no entorpecer en la cocina salón con 2 terrazas grande con chimenea. Una de ellas está cerrada con cerramiento y sirve para habitación o despacho o q se requiera a gusto de las necesidades de ca uno, tiene mucho sol y vistas al jardín, suelos rústicos. Terraza abierta más pequeña para tender y da a la piscina y vistas, entrada con una cancela cerrada de aluminio y ventana oscilobatiente y puerta corredera antimosquitos y entrada a la casa con holl amplio q de frente el salón, derecha habitaciones e izda. Cocina. Portero automático y puerta con motor para meter el coche si uno quiere hay suficiente para aparcar fuera, pero tiene su cochera por si quieres meter motos o bicis. Segunda vivienda las dos miden 150metros cada una. Entras y tienes un salón garaje muy grande con armario, para lavadora o secadora y preparada para poner pila si quieres, cuarto de calderas con depósito 750 litros y tiene espacio para trastos, 2 habitaciones una forrada toda de madera con armario empotrados 3 cuerpos más maleteros amplios da a la piscina, otro salón muy grande con la cocina tipo isla y chimenea, tiene unas puertas correderas grandes para diferenciar los espacios, luego otra habitación con puerta corredera aire acondicionado y bomba de calor y baño completo con ventana mosquitera y plato de ducha. Está para entrar a vivir.', 'https://robohash.org/laboreullamaut.png?size=50x50&set=set1', 'CHALET', 803.38, 300 , 5, 2, false, true, true, true, 24, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso Acogedor', 'Casco Antiguo, Cáceres', 'Se alquila apartamento muy luminoso en la zona de Cáceres. Tiene una superficie de 55 m2, distribuidos en 2 habitaciones, 1 baño, comedor y cocina, con electrodomésticos. Es exterior, con una excelente situación cerca de colegio, farmacia, ambulatorio, parque y parada de bus. CIUDAD MONUMENTAL. Apartamento de unos 65 m2 aproximadamente a menos de 2 minutos andando de la Plaza Mayor de 2 dormitorios(el principal con cama de matrimonio de 1,35 y armario de 4 puertas y el pequeño con cama de 90 y armario empotrado de 2 puertas, 1 baño completo con bañera, salón comedor con cocina americana más arcón congelador y terraza de unos 25 m2 aproximadamente. Totalmente amueblado, suelos de tarima. Aire acondicionado y calefacción individual electrifica. Todo exterior y muy luminoso. No mascotas. Comunidad e internet incluidos en el precio. Gente seria y responsable que acredite sus ingresos.', 'https://robohash.org/veniamiustoqui.png?size=50x50&set=set1', 'PISO', 450, 55, 2, 1, false, false, true, false, 13, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa Los Rodríguez', 'La Sierrilla, Cáceres', 'Situado en la Sierrilla, la zona de mayor exquisitez urbanística de Cáceres. Es una construcción de diseño proyectada sobre una parcela de 1142 metros cuadrados, con diversos tipos de árboles frutales, palmeras, dos porches cubiertos en la estructura de la vivienda y una pérgola para las noches de verano; piscina con iluminación interna y riego por aspersores, espacio vallado con casita para perro y casa de almacenaje con la depuradora. La vivienda se construyó en el año 2000 con materiales de máxima calidad y todo tipo de detalles y comodidades. Cuenta con 145 metros cada una de las tres plantas, estando el garaje integrado en la estructura de la vivienda. Se diseñó con el propósito de sacarle el mayor rendimiento a su orientación y con diversas capas de materiales de gran consistencia en aislamiento para evitar cualquier tipo de problemática en cuanto a humedad. Considerando la amplitud de las estancias, se distribuye en salón de doble ambiente, dos cocinas equipadas con todos los electrodomésticos, cinco dormitorios con armarios empotrados –el principal tiene terraza, armario corrido tipo vestidor y baño completo con hidromasaje tres baños y un aseo, despensas y estancias de almacenaje.  Como características más destacadas cuenta con calefacción por gasóleo, independiente en cada planta, aire acondicionado por conductos, también independiente, puertas blindadas, suelo de tarima, azulejos Porcelanosa, carpintería de roble de gran calidad, ventanas de doble acristalamiento y climalit, hilo musical en todas las estancias… Comunidad de 42Euros por mantenimiento de la urbanización.', 'https://robohash.org/voluptatemenimnihil.png?size=50x50&set=set1', 'CASA', 1500.94, 435, 5, 4, false, true, true, true, 36, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa Rural', 'Urb. El Fargue, Albaicín, Granada', 'Casa independiente con: 3 dormitorios. Amplio salón con cocina incorporada. Baño. Patio exterior. Porche. Con 2000 metros de parcela, en el precio esta incluido el agua de la acequia ainadamar y las placas solares. Agua potable de pago. Calefacción de gasóleo. Chimenea. Totalmente amueblada. Autobús urbano a tres minutos. Tarifa TAXI ciudad.', 'https://robohash.org/porropraesentiumdistinctio.png?size=50x50&set=set1', 'CASA', 1100, 100, 3, 1, false, false, false, true, 23, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en alquiler en FLOTA DE INDIAS', 'Ramón de Carranza - Madre Rafols, Sevilla', 'FANTÁSTICA VIVIENDA en primera planta alta de gran edificio de LOS REMEDIOS. GRAN OPORTUNIDAD DE VIVIR MIRANDO AL ALJARAFE SEVILLANO Y A LA FERIA. Magnífico piso en venta en el Barrio de Los Remedios, exterior de 4 habitaciones que goza de gran situación, a unos minutos de la parada de Metro. Próximo a colegios de la zona, comercios y servicios de autobuses, a un paso de la Feria y del conocido Parque de los Principes. La vivienda es luminosa donde poder disfrutar de grandes vistas, podrá convertirla en un hogar maravilloso y confortable, con distintas posibilidades de reforma. El Piso cuenta con muchas posibilidades un hall de entrada desde donde se distribuye la vivienda, con un posible gran salón – comedor con salida a una amplia terraza que comunica con la calle Flota de Indias. Junto al salón se encuentra un baño que dará servicio a sus invitados. Frente al salón podrá disfrutar de un fantástico espacio donde montar una moderna cocina, y un lavadero donde poder lavar su colada. En el pasillo nos encontramos con estancias de 4 dormitorios, algunos con Armarios Empotrados y 2 baños completos, uno de ellos en Suite en el dormitorio principal. Su distribución permite sacar dos fantásticos vestidores donde ubicar todas sus pertenencias. Para su bienestar, el edificio posee dos ascensores y en el portal tiene acceso para personas con movilidad reducida. La propiedad posee una plaza de garaje incluida en el precio y situada en el mismo edificio, donde se accede desde el ascensor que les lleva a su vivienda. ¿Quiere saber más? Estamos encantados de ayudarle a elegir el mejor hogar para su familia.', 'https://robohash.org/iureconsequuntursed.png?size=50x50&set=set1', 'PISO', 765.22, 222, 4, 2, true, false, true, false, 43, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso barato en Barcelona', 'Les Roquetes, Barcelona', 'Piso en alquiler en Barcelona. Dispone de una superficie de 59 m2 distribuidos en salón-comedor muy luminoso con acceso a balcón, 3 habitaciones, cocina y 1 baño. Situado en una zona cerca de servicios, comercios, paradas de autobús y la parada de metro Roquetes (L3). Con fácil acceso a la B-20. Se alquila sin amueblar.', 'https://robohash.org/eoseaqueest.png?size=50x50&set=set1', 'PISO', 788.51, 65, 3, 1, false, false, true, false, 10, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en Fotógrafo Angel Llanos, 14', 'As Travesas - Balaídos, Vigo', 'Se alquila precioso piso nuevo en Fotógrafo Ángel Llanos, muy cerca de Florida, Balaidos, Plaza America y zona de playas. Inmejorable situación. Cuenta con todos los servicios necesarios cerca, así como supermercados, paradas de autobús, entidades bancarias, parques, colegios, farmacias, etc… El piso se alquila amueblado y se distribuye en hall de entrada, cocina completamente equipada con todos los electrodomésticos (horno, vitro, campana, frigorífico combi, microondas, LAVAVAJILLAS), zona de lavadero con lavadora y tendal, amplio salón comedor con todo tipo de mobiliario y sofá con mecanismo eléctrico, dos dormitorios completos con armarios empotrados (camas de 135 y 90 cm respectivamente), tercera habitación VESTIDOR con grandes armarios empotrados con mucho espacio y dos baños completos ambos con plato de ducha. También dispone una buenísima plaza de garaje en el mismo edificio incluida en el precio y un trastero individual con suelo de plaqueta. Buenísimas calidades de construcción en toda la vivienda, electrodomésticos de primeras marcas y ventanas aislantes. Se aceptan mascotas siempre y cuando se haga la visita con la misma y se cumplan requisitos.', 'https://robohash.org/errorquiaaut.png?size=50x50&set=set1', 'PISO', 770, 88, 2, 2, true, false, false, true, 40, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Esmeralda (Chalet adosado en calle Toronga, 11)', 'Conde Orgaz-Piovera, Madrid', 'Se alquila duplex de 250 metros en la zona de Arturo Soria una de las mas prestigiosas de la ciudad, a 3minutos andando del Liceo Frances. La vivienda consta de 3 dormitorios, el ppal. en suite y los otros 2 dobles comparten un baño y en la planta baja se encuentra una gran cocina de 45 m2 con zona de comedor para 8 personas y barra de. desayuno. Se encuentra un gran salòn con salida a la piscina y jardin privado para uso exclusivo del inquilino, y un aseo. La casa dispone de trastero En las inmediaciones se encuentran varios colegios de. prestigio y centros comerciales como. Carrefour, Mercadona, Palacio de hielo, El corte ingles etc. Muy bien comunicado con varias lineas de autobuses y el metro de Arturo soria. La vivienda se entrega semi amueblada.', 'https://robohash.org/illumsapientevel.png?size=50x50&set=set1', 'CHALET', 2495.6, 235, 3, 3, false, true, true, true, 33, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en Zapillo', 'C/ Paterna del Río, Almería', 'Si lo que estás buscando es un apartamento en el mismo Paseo Marítimo, aquí tienes la oportunidad. Un amplio salón con grandes ventanales que entra luz por doquier. Dormitorio con gran armario empotrado. Si te gusta oler a mar y disfrutar del paseo marítimo todo el año ya puedes venir a verlo. Parada de autobús al bajar de casa, todo tipo de comercios en la zona como supermercados, fruterías, restauración, etc.', 'https://robohash.org/commodiquopraesentium.png?size=50x50&set=set1', 'PISO', 550.65, 55, 1, 1, true, false, true, false, ´5, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet independiente en calle de Santa Isabel, 51', 'Els Masos, El Vendrell', 'Casa individual con piscina privada distribuida en dos plantas, situado en la urbanización Dels Garrofers zona muy tranquila con poco tráfico. En la entrada nos encontramos con dos zonas de terraza, en una de ellas tenemos un fabuloso chill out para disfrutar de las noches de verano y un fabuloso garaje! Al entrar por la puerta principal de la vivienda encontrará recibidor, cocina, aseo y comedor con chimenea con salida a un porche exterior y piscina En la primera planta, se encuentran los 4 dormitorios tres de ellos dobles y 2 cuartos de baño uno de ellos en la Suite. La decoración es detallista, ofreciendo un ambiente acogedor. Tiene una superficie construida de 397 metros cuadrados. Tiene a su disposición un jardín fabuloso con césped artificial y jardinera que no le harán ser un esclavo para su mantenimiento. Encontrará la piscina y un cuarto de maquinas en la parte posterior del chalé con ducha exterior. En esta casa, podrá disfrutar de un micro clima todo el año y de la vida en exterior. Tambien tiene una barbacoa de piedra fija y facilidades para cocinar. La Urbanización cuenta con servicios y comodidades. A escasos minutos de la playa de Coma-ruga incluso caminando y muy cercano a supermercados y gasolinera. Excelente comunicación con (AP-7, C-32) carretera y tren. Junto al Vendrell, que la abastece de todos los servicios indispensables para su bienestar: hospital, farmacias, colegios, comercios…A tan solo 45 minutos de Barcelona y su aeropuerto. Esta muy bien conservada y equipada con calefacción de gas natural y aire acondicionado, armarios empotrados y mucho mas.', 'https://robohash.org/odioaliquamlabore.png?size=50x50&set=set1', 'CHALET', 1500.08, 397, 4, 3, false, true, true, true, 45, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa adosado en calle Vicente Trueba, 7', 'Alisal - Cazoña - San Román, Santander', 'Urbanización Altamira, chalet adosado, en zona residencial. Puesto con muy buen gusto…  Impecable. Cuenta con 4 plantas. Planta sótano con 2 grandes trasteros, zona de almacenaje y lavadoras y un amplio garaje cerrado también con zona de almacenaje. Planta baja con un porche de entrada cerrado, cuarto de baño completo, amplia cocina completamente equipada y gran salón comedor con chimenea y salida al jardín (35m2). Planta primera con 3 habitaciones completas (la suite con vestidor) y cuarto de baño con bañera de hidromasaje. Planta segunda o bajo cubierta, gran habitación/espacio multiusos, diáfano con dos velux.', 'https://robohash.org/necessitatibusanimirerum.png?size=50x50&set=set1', 'CASA', 1200.44, 180, 4, 2, false, false, true, true, 15, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en calle medinaceli', 'Centro, Soria', 'Se alquila excepcional y luminosa vivienda en quinta planta con unas vistas únicas al parque de la Dehesa, y con una ubicación inmejorable dentro de la zona centro de la ciudad. Una oportunidad excelente de vivienda de calidad en la capital soriana. Perfecta para funcionarios/trabajadores que busquen compartir una vivienda amplia, o pareja/familia. La finca es un edificio regio y de estilo arquitectónico sobrio, elegante y minimalista. Y la vivienda cuenta con abundante luz natural en diferentes orientaciones a lo largo del día, vistas alegres y extensas y amplitud en sus estancias. La casa, ubicada en una quinta planta, cuenta con orientación Oeste fundamentalmente, y con un balcón que da al famoso parque de la Dehesa, pulmón verde de la ciudad, uno de los puntos fuertes de la vivienda, pues brindan unas vistas inigualables del entorno durante todo el día. 84 m2 útiles de vivienda que se reparten en recibidor, gran salón comedor, amplia cocina independiente, 3 dormitorios dobles y 2 baños completos. Electrodomésticos nuevos a estrenar en la cocina, baños recién reformados en su totalidad y mobiliario nuevo mezclado con otras piezas más clásicas y en perfecto estado y calidades. El suelo es de parquet y la calefacción es central con radiadores originales metálicos (la mejor opción para Soria). Y la iluminación es de tipo LED de bajo consumo. Armarios y demás muebles de almacenaje en cada estancia. La finca cuenta con dos ascensores y portero físico, y la vivienda se alquila con una plaza de garaje en el mismo edificio incluida en el precio. Los gastos de suministros de agua caliente y calefacción se cobran con un fijo incluido en el precio al mes de 150€. Si hubiera un exceso de consumo en los suministros se notificaría y cobraría a parte. Luz y agua fría a parte, a domiciliar en la cuenta bancaria del inquilino, y abonar según consumo.', 'https://robohash.org/quoetexcepturi.png?size=50x50&set=set1', 'PISO', 900.71, 84, 3, 2, true, false, true, true, 44, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Estancia Campos De Lino en avenida de Los Recreos', 'Girón - Villa del Prado, Valladolid', 'Se alquila casa de una planta con patio en el barrio Girón. La vivienda está totalmente reformada y cuenta con tres dormitorios, salón, cocina amueblada y equipada con todos los electrodomésticos y un baño. Amueblada. Patio de noventa metros cuadrados y almacén con portón (no tiene vado). Se encuentra en la parte baja del barrio, junto a Mieses. Se piden nóminas y fianza. Ven a visitarla.', 'https://robohash.org/autemetet.png?size=50x50&set=set1', 'CASA', 850.19, 79, 3, 1, false, false, true, true, 50, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en Sagasta', 'Centro Histórico - Plaza España, Cádiz', 'Piso en alquiler como vivienda habitual. Tiene 3 dormitorios uno interior y dos exteriores. Salón con dos balcones, exterior. Cocina amueblada sin electrodomésticos, solo tiene placa de gas. Termo de gas butano. El cuarto de baño tiene ducha. La vivienda no está amueblada. Es una 4ª planta SIN ASCENSOR, es la última planta del edificio, muy luminoso y céntrico. La azotea está disponible para poder tender. Tiene supermercados cerca, zona comercial, centro histórico. Las condiciones de alquiler son las siguientes, un mes de fianza para depositar en la J. A., contrato de vivienda habitual, y presentar documentos y nóminas que justifiquen la capacidad de pago de la renta del alquiler, (superar el S. M. I más el importe del alquiler). Los honorarios de inmobiliaria son el importe de renta mas los impuestos correspondientes por parte del inquilino. Es necesario dar de alta los suministros de luz y de agua. El importe del alquiler son 600€ mensuales.', 'https://robohash.org/quidemplaceatconsequatur.png?size=50x50&set=set1', 'PISO', 600.14, 60, 3, 1, false, false, true, false, 14, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'El Refugio, Casa en calle Albahaca Nº36', 'Hervencias Altas - El Pinar, Ávila', 'COMO ES: Esta es una vivienda unifamiliar adosada, situada en una zona residencial consolidada y muy reconocida de la moderna ampliación de la Ciudad, totalmente exterior, independiente en todos sus servicios, con una orientación excelente, suroeste en la fachada de parcela y noroeste en la de la entrada. Super luminosa y bien soleada con espacio de vida y de ocio de grandes proporciones. Muchas actualizaciones de calidades y materiales como las ventanas de PVC, la tarima AC6, la ampliación del espacio libre en el salón, el completísimo equipamiento de la cocina que incluye electrodomésticos de gama alta o el ático totalmente acondicionado para múltiples usos. QUE INCLUYE: La vivienda se encuentra distribuida en tres plantas, la baja, con vestíbulo, salón comedor, cocina, baño, el garaje y la parcela de ocio que tiene dos zonas, la de estar con un porche acondicionado y cerrado acristalado y la de la jardín, en la que se puede instalar una piscina o cualquier otra instalación de disfrute, jardín y perfectamente perimetrada. La primera planta contempla tres dormitorios de tamaño muy generoso, el principal tipo suite y con un práctico, vestidor, y dos cuartos de baños. En la planta superior, la del ático, un espacio diáfano de planta entera que tiene múltiples posibilidades de distribución y aprovechamiento. QUE POSIBILIDADES TIENE: Tanto por necesidad familiar o simplemente porque quieres más espacio, vivir de forma independiente o acceder a la calidad de vida que ofrecen estas vivienda, ésta es perfecta. Porque además de haberse mejorado muchísimo en su calidades y equipamiento se encuentra en un estado impecable, lista para amueblar y disfrutar. SU ENTORNO Y UBICACION: La v vivienda forma parte de la Urbanización Dehesa del Pinar. un conjunto urbanístico desarrollado hace unos 15 años y que mantuvo la estructura e imagen construida y que ha dado lugar a una urbanización muy agradable, y cómoda par vivir. Fácilmente accesible cuenta con zonas ajardinadas, con espacios de juegos infantiles, tiene paradas de autobús urbano y en coche se tarda 10 minutos en llegar al Centro de la Ciudad además de estar bien conectaba con el resto de zonas y las salidas principales a otras vías.', 'https://robohash.org/etquamcorrupti.png?size=50x50&set=set1', 'CASA', 900.77, 202, 3, 3, false, false, true, true, 7, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet independiente en calle Lamas de Prado, 66 B', 'La Milagrosa, Lugo', 'Casa independiente que en su planta baja se accede al garaje. La primera planta consta de dos habitaciones, una de ellas de matrimonio, la segunda con dos camas gemelas de 90cm, baño completo y un amplio salón comedor, la cocina esta equipada con electrodomésticos y da acceso a la joya de la casa que es una gran terraza cubierta bien orientada para aprovechar así gran cantidad de luz durante todo el día. Y para finalizar en la segunda planta también incluimos una zona completamente diáfana y con entrada de luz natural.', 'https://robohash.org/doloremdoloremquemodi.png?size=50x50&set=set1', 'CHALET', 420.34, 150, 2, 1, false, false, true, true, 31, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa independiente en calle Naon, 20 A', 'Viella-Granda-Meres, Siero', 'Se alquila CASA con JARDÍN en la Carretera de Viella de Lugones, muy cerca de Lugones donde tiene todos los servicios y del CC Parque Principado. Es una casa de dos plantas con dos viviendas y de la que se alquila la planta baja. Con una superficie de 93 m2 distribuidos en 3 dormitorios, salón, cocina amueblada y equipada con electrodomésticos y baño. Dos de los dormitorios están amueblados. La casa incluye jardín, garaje, una caseta de aperos y una zona con barbacoa. La calefacción es de gas natural.', 'https://robohash.org/velquaequia.png?size=50x50&set=set1', 'CASA', 650.24, 93, 3, 1, false, false, true, true, 6, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet independiente en ronda San Cristobal', 'Cizur, Navarra', 'Espectacular vivienda unifamiliar con mucho encanto, cálida y acogedora con muy buena calidad constructiva además de una excelente distribución.  Destaca también su buena situación dentro de la Urbanización. Si quieres vivir en un unifamiliar aislado en Zizur Mayor Urbanización ven a verlo! Cuenta con precioso jardín totalmente consolidado con piscina de 49 m2. Y acceso directo a zona común de 7300 m2 con piscina y mobiliario jardín. La parcela es de 1326 m2 y esta muy bien orientada además de ser totalmente llana. De la distribución de la casa hablaremos ahora, destacando la cantidad de luz y su gran distribución además de sus amplios espacios y grandes ventanales. La vivienda cuenta con dos plantas sobre rasante y una planta bajo rasante. PLANTA BAJA: Desde esta planta podemos acceder de la calle directamente al jardín y a la vivienda por la puerta principal. Al acceder a la vivienda nos encontramos un gran vestíbulo con doble altura y grandes ventanales que le dan mucha luz. En esta planta además tenemos un gran salón comedor con chimenea y diferentes ambientes, una amplia cocina con ventanal al jardín y salida al porche que cuenta con toldos automáticos y comunicado con el jardín de la casa. Además en esta planta tenemos 2 habitaciones dobles y dos baños, siendo una de ellas la habitación principal con amplio ventanal al jardín y que cuenta con un gran vestidor y un baño en suite con ventana al jardín. PLANTA PRIMERA: A esta planta se accede desde una escalera que se sitúa en el vestíbulo de la casa y que te llevara a las 4 amplias estancias dormitorios y dos baños que encontraremos en esta planta. Dos habitaciones cuentan con ventanas velux automáticas y otras dos con amplios ventanales al jardín y salida a balcón. PLANTA SOTANO: Esta planta cuenta con varias zonas bien diferenciadas. Por un lado tenemos el garaje de 41 m2, un gran txoko con cocina equipada de 133 m2 además de un gimnasio equipado y una bodega. Del gimnasio se puede acceder directamente al jardín. En esta planta hay además una habitación y un aseo. La vivienda esta en perfecto estado y tienen muchas mejoras que paso a enumerar: -La carpintería exterior es de Aluminio con rotura de puente térmico y persianas motorizadas en toda la casa. Además cuentan con mosquiteras. -Toda la vivienda esta climatizada. Además de bien aislada. -El jardín cuenta con riego automático por aspersión y por sectores. -La piscina esta en perfecto estado. En uno de los laterales de la casa, que esta pavimentado, se pueden dejar hasta 2 coches. En el garaje convencional caben otros 2. Ven a visitarla!', 'https://robohash.org/delectusatqueeum.png?size=50x50&set=set1', 'CHALET', 3000, 465, 6, 5, false, true, true, true, 37, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en calle Orient', 'Santa Eugenia, Girona', 'PROMOCIÓN: 1 MES DE ALQUILER GRATIS si reservas antes del 28 de febrero. Y además, ¡sin comisiones de agencia! Piso en alquiler de 77 m² ubicado en Girona. Vivienda de segunda mano que pertenece a un edificio residencial construido en 1959 aproximadamente, localizado en la cuarta planta con la siguiente distribución: salón-comedor con balcón, cocina con galería amueblada independiente, equipada con placa vitrocerámica, horno y campana extractora de humos, 3 dormitorios y 1 baño. Además, cuenta con armarios empotrados y radiadores para la calefacción. Siempre es una inversión rentable. El inmueble está ubicado en zona residencial consolidada, cerca de varios servicios y equipamiento como supermercados, cafeterías, plazas, centros deportivos, parques, centros educativos y otros establecimientos comerciales. Bien comunicado mediante estación de tren a 7 minutos en coche y a 13 minutos andando. También enlaza con las principales carreteras de la zona por su uso en menos de 5 minutos aproximadamente. Con nuestros servicios podrá encontrar la vivienda que necesita. Empiece ahora mismo pidiendo más información. Un responsable cercano a usted le atenderá personalmente. “[A efectos informativos, se hace constar que el índice de referencia de precios de alquiler de la vivienda es de 9,21€/m2. ]” Requisitos: 1 mes de fianza. Seguro de vivienda y de impagos a cargo del inquilino. Se llevará a cabo un análisis de solvencia para el que solo se tendrán en cuenta ingresos demostrables. Promoción válida para contratos firmados antes de 28 de febrero del 2023 (incluido). Esta promoción no es acumulable. Condiciones válidas para inmuebles identificados en webs y portales con detalle promocional de campaña identificado en descriptivo del anuncio.', 'https://robohash.org/doloresomnisexercitationem.png?size=50x50&set=set1', 'PISO', 814.98, 76, 3, 1, false, false, false, false, 48, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet independiente en calle Junco, 1', 'Alcolea, Córdoba', 'Chalet situado en Urbanización Encinares de Alcolea. Vivienda en planta baja tiene 5 estancias amplia cocina, salón con chimenea. La habitación principal dispone de baño, vestidor. Buhardilla de 20m, sala de usos múltiples de 29m en zona semisótano y garaje 40m. Aire acondicionado frío y caliente centralizado. Terreno con magnificas vistas a la campiña, la casa esta situada en la parte alta con magnificas vistas. Piscina con baño, vestuario y dos terrazas. Dispone de garaje, zonas ajardinadas, árboles frutales. A 12km de Córdoba. Espacio para plantar más plantas, el terreno completo son 3200 metros cuadrados. Para amantes de las plantas y la naturaleza. SE ALQUILA A PARTIR DEL 15 DE ABRIL. Alquiler de larga duración.', 'https://robohash.org/commodiametnatus.png?size=50x50&set=set1', 'CHALET', 1250.36, 328, 5, 3, false, true, true, true, 19, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
