insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa independiente en calle Galia', 'Alicante Golf, Alicante / Alacant', 'Espectacular chalet de diseño de 500 m2, en parcela de 1.220 m2, en el corazón de la Playa de San Juan. Entre el Golf y el mar. Todo un lujo! Dispone de piscina privada y seis dormitorios, totalmente amueblados. 5 baños, dos de ellos con bañera de hidromasaje. La suite principal tiene más de 40 metros, incluye cama de 2x2 metros con colchón de látex, persianas de seguridad automáticas, amplio vestidor, baño con ducha de mármol y bañera de hidromasaje con madera de Teka de la marca Jacuzzi, con luz bajo el agua y vistas al jardín, sistema multiclin de Roca en el wc, que integra el bidé y el inodoro en una experiencia de lujo. Salón de 100 metros con chimenea automática a gas, TV. Cocina isla y vistas al jardín y electrodomésticos Siemens. Zona lavadero, con lavadora de gran capacidad y 2 secadoras. Amplias zonas comunes interiores. Porches y terrazas de más de 100 metros, dotados de tumbonas, y parasoles. Zona solárium piscina de césped artificial. Tiene iluminación nocturna automática por led, iluminación en piscina. Estores solares automáticos. Garaje cerrado para cuatro vehículos. La villa está situada en la zona del golf de la Playa de San Juan. Tiene acceso andando a todos los servicios, supermercado a 250 metros, cafeterías, restaurantes, comercios, bancos, correos, TRAM con dos paradas muy cerca y autobuses a 200 metros, pero en parcela privada de total tranquilidad. Playa de la Albufereta andando a 14 minutos, a 900 m de distancia. El club de Golf de Alicante andando a 950 metros. El club náutico a 800 metros, dónde se puede practicar vela y otros deportes náuticos. El espectacular Gimnasio Arena a 800 metros. La Playa de San Juan a 1.900 metros, a 27 minutos caminando y a 7 minutos en coche. Los restos arqueológicos de Lucentum, antigua ciudad romana a 600 metros. El centro de la ciudad de Alicante a 6,7 kilómetros, a 12 minutos, accesible en coche, tranvía o autobús, con las principales cadenas comerciales en la Avd. Maisonnave y sus animados restaurantes, pubs y discotecas. La divertida ciudad de Benidorm a 42 km y a 30 minutos en coche, con el parque de atracciones Terra Mítica, el parque de vida salvaje Terra Natura y el parque acuático Aqualandia.', 'https://robohash.org/molestiaeenimblanditiis.png?size=50x50&set=set1', 'CASA', 6000.12, 500, 6, 5, false, true, true, true, 4, 'de4fab48-c431-54b6-ac87-3d5856774866');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en paseo heriz', 'Antiguo, Donostia-San Sebastián', 'En el barrio del Antiguo, en edificio de construcción reciente, alquilamos este caprichooso apartamento. Consta de salón comedor, cocina equipada y dormitorio con amplio armario y baño con ducha incorporado, tipo suite. Se accede a una amplia terraza tanto desde el salón como desde el dormitorio con vistas a la bahía, Monte Igeldo, Isla Santa Clara y Monte Urgul La carpintería interior es de madera, ventanas climalit y los servicios individuales mediante caldera de gas natural. Dispone de un garaje cerrado motorizado en el mismo edificio de 28 m2. que esta comunicado con la vivienda mediante ascensor. Se solicitan nóminas, 1 mes de fianza a depositar ante el gobierno vasco y 2 meses de depósito adicional. Los honorarios de la agencia inmobiliaria son por cuenta del inquilino. No se admiten mascotas.', 'https://robohash.org/animiquasperferendis.png?size=50x50&set=set1', 'PISO', 921.43, 43, 1, 1, true, false, true, false, 21, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
