insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa independiente en calle del Pare Lluís Navarro', 'El Cabanyal-El Canyamelar, València', 'Casa independiente en alquiler temporal en el barrio del Cabañal ALQUILER DE CORTA ESTANCIA  A PARTIR DE SEPTIEMBRE 2023. Alquiler de preciosa casita individual de dos plantas, a 5 minutos caminando a la playa. Esta bonita casa está distribuida en dos plantas, en la parte de abajo se encuentra el salón comedor muy luminoso con sofá, 2 sillones, un Smart Tv de 50 pulgadas, con un baño completo y zona de trabajo adicional, con mesa extensible si lo necesitas. En la parte superior una habitación con una amplia cama de matrimonio con otro Smart Tv, ventanas con aislamiento térmico y acústico para una mayor tranquilidad, un segundo baño completo con ducha, una segunda zona de despacho y terraza privada con una pequeña fuente para disfrutar de agradables momentos de lectura o descanso. Se encuentra situado en el antiguo barrio del Cabañal, muy cerca de la playa, y muy bien comunicada con el centro de la ciudad, todos los servicios y transporte público. Si le gustaría visitar esta vivienda, no dude en ponerse en contacto con nosotros, esteremos encantados de atenderle', 'https://robohash.org/magnamquiadolor.png?size=50x50&set=set1', 'CASA', 1450.02, 100, 1, 2, false, false, true, false, 49, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet pareado en Santa Marta de Tormes', 'Área Metropolitana, Salamanca', 'Solución inmobiliaria ofrece EN ALQUILER espectacular chalet pareado en la URB. ATIKA, una de las mejores Urbanizaciones de Salamanca, sin amueblar. El chalet consta de 74 m2 en la planta baja y en la 1º planta de 64 m2, distribuidos en 3 habitaciones, 3 baños, salón con salida a amplio balcón, cocina amueblada y equipada. Garaje de 63 m2 en planta baja con habitación para almacenar y consta de jardín La Urbanización consta de zonas comunes como Piscina, Pista de Paddel, Tenis; jardines, etc. Este anuncio no es vinculante y puede contener errores; se muestra a título informativo y no contractual. Gracias por su tiempo.', 'https://robohash.org/eosexpeditaquibusdam.png?size=50x50&set=set1', 'CHALET', 900.76, 201, 3, 3, true, true, true, true, 41, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
