insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en Olivar, 25', 'Lavapiés-Embajadores, Madrid', 'Vivienda exterior con tres balcones en el salón a una calle muy tranquila. Recién reformada y perfecto estado. Muy luminosa. Calefacción y aire acondicionado individuales. La cocina cuenta con lavadora/secadora y frigorífico. Se alquila sin muebles, aunque se da la opción de dejar la cama y algún otro mueble si interesa al inquilino. Los gastos de comunidad están incluidos en el precio. No incluidos los consumos (agua, electricidad, internet.. . ). Sin comisión de agencia ni para el propietario ni para el inquilino. Requisitos: Contrato de trabajo indefinido y las 3 últimas nóminas. 1 mes de fianza y, si se quiere mobiliario, 1 mes de depósito.', 'https://robohash.org/sedprovidentarchitecto.png?size=50x50&set=set1', 'PISO', 875.59, 85, 6, 3, false, false, true, false, 33, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en calle San Millán', 'El Ejido, Málaga', '¡Ésta es tu oportunidad de conseguir un piso de calidad por un precio increíble! Este fantástico piso de cuatro dormitorios se encuentra totalmente amueblado. Tiene una cocina equipada con todos los electrodomésticos necesarios. Además de ello, cuenta con dos grandes cuartos de baño. Está a menos de 1 minutos de la Facultad del Ejido y también se encuentra muy bien comunicado con el centro, ya sea andando o vía bus. Piso reformado, exterior muy soleado, aire acondicionado frío/calor en todas las estancias, baños y cocina de primera calidad. La zona le permite también disfrutar de todo tipo de servicios como restaurantes, bares, supermercados y centros de salud. ¡Venga a verlo! Se informa al cliente que los honorarios de agencia por los servicios prestados durante la operación de arrendamiento son de 1 mensualidad. Así también se pone en su conocimiento que es necesario acreditar SOLVENCIA mediante ingresos demostrables.', 'https://robohash.org/quiundenihil.png?size=50x50&set=set1', 'PISO', 1600.38, 125, 4, 2, true, false, false, false, 28, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa adosado en calle CASTILLO DE ALMORCHÓN', 'Avda. Elvas, Badajoz', 'Se alquila vivienda en la urbanización Guadiana, zona tranquila rodeada de zonas verdes y de todas las necesidades del día a día. La vivienda se encuentra en perfecto estado (vivienda recién pintada al completo, cuartos de baños reformado (excepto uno) y cocina totalmente reformada con todos los electrodomésticos incluidos. La vivienda se divide de la siguiente manera: -En primera planta consta de salón, cocina con acceso a patio y un aseo -En segunda planta tendríamos cuatro dormitorios y dos cuartos de baños completos (uno en suite con el dormitorio principal) -En planta sótano tendríamos cochera privada con espacio para dos coches y moto e incluso zona de trastero. La vivienda se encuentra lista para poder entrar. Aprovecha la oportunidad y ven a verlo con nosotros.', 'https://robohash.org/eosadipiscidistinctio.png?size=50x50&set=set1', 'CASA', 900.96, 259, 4, 3, false, false, true, true, 8, '3724f1a1-cfed-52ec-b1fa-9c41b6928648');
