insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet independiente en calle de la Muntanyeta de Sant Josep, 26', 'Zona Playa de la Concha, Oropesa del Mar', 'Villa luminosa familiar con jardín, a 100 metros de la playa de arena y a 50 de la zona de la Isleta y de las rocas. Espectaculares vistas sobre la playa de Morro de Gos, Alcocebre, Peñíscola. En la primera planta se encuentra el comedor con chimenea muy amplio, cocina con office donde puedes comer o desayunar, y un aseo. 4 dormitorios con armarios empotrados (2 de ellos con acceso a una terraza desde la que puedes ver un bonito amanecer) y 2 baños completos se encuentran en la planta superior. Garaje para 1 coche (con espacio además para moto, bicis o almacenaje) en el semisótano. Es posible aparcar otro vehículo en el exterior de la vivienda. La casa está rodeada por un jardín con barbacoa y otra amplia terraza para disfrutar junto a la brisa del mar. Solo alquiler de larga estancia, mínimo 1 año.', 'https://robohash.org/quisabvoluptatem.png?size=50x50&set=set1', 'CHALET', 900.13, 300, 4, 3, true, true, true, true, 16, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa independiente en Passatge Oriol', 'Valldoreix, Sant Cugat del Vallès', 'Casa práctica con sus estancias principales en una sola planta, se compone de 3 habitaciones, 2 individuales y una de matrimonio. Las tres cuentan con armarios empotrados. Adicionalmente Un baño completo y un aseo de cortesía. Espacioso de salón comedor con cocina abierta con terraza a pie de salón. Parcela de 350 m2, que te ofrece zonas amplias para disfrutar de barbacoas con familia y amigos. Tiene accesos por dos calles. Por el lado de acceso de los coches tienes un espacio de almacén o trastero. Casa disponible para entrar cuando tu desees.', 'https://robohash.org/exeosvoluptatem.png?size=50x50&set=set1', 'CASA', 1529.37, 126, 3, 2, false, false, true, true, 10, '5bd0ab0d-7b12-5485-a1c2-83d3d463add8');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa independiente en Iñas, cerca centro comercial', 'Nós, Oleiros', 'Planta alta de chalet con entrada y finca independientes. Amueblado. Cuenta con 4 habitaciones, 2 baños, salón y cocina. Todas las estancias son muy amplias. Buen estado. Cuenta con una bonita finca ajardinada e independiente de unos 1.000 m2. Dispone de dos plantas independientes que se alquilan por separado. Cada planta tiene su propia entrada y finca independiente. El entorno inmediato es muy tranquilo y a la vez bien comunicado, próximo al parque comercial de Oleiros. Condiciones de alquiler: -1 mes de fianza -1 mes garantía adicional -seguro de alquiler. -no se admiten mascotas.', 'https://robohash.org/perferendisfugiatqui.png?size=50x50&set=set1', 'CASA', 700.35, 120, 4, 2, false, false, true, true, 1, '2bd9e760-a11e-5d8f-9641-1c54e79c57a1');
