insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet adosado en calle Gorbea, 1', 'Legutio, Álava', 'ALQUILER CON OPCIÓN A COMPRA Vivienda unifamiliar adosada de tres plantas en pleno centro de Legutiano. Posibilidad de intercambio por un piso o de alquiler con opción a venta La casa se compone de la siguiente manera: Planta baja: Txoko, garaje y jardín exterior de 40m Planta primera, Entrada exterior de unos 20m2, recibidor, cocina, gran comedor, baño, y una pequeña habitación que podría ser utilizada como desván. Planta 2: Tres amplias habitaciones, todas exteriores con terraza y una de ellas con un bonito mirador al monte Gorbea. Planta 3: Ático totalmente reformado en madera rústica con disponibilidad de agua. La distancia a Vitoria es de tan solo 12 km de autovía libre de peaje No dudes en preguntarnos por ella, somos flexibles con el precio indicado. Legutio es un precioso pueblo rodeado de hayedos, robledales y un embalse precioso unido al parque natural del Gorbea.', 'https://robohash.org/aliasestvitae.png?size=50x50&set=set1', 'CHALET', 1236.7, 210, 5, 4, false, false, true, true, 2, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
