insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en calle ALFONSO I', 'Alfonso, Zaragoza', 'Precioso y coqueto apartamento reformado en el centro de zaragoza. Nuevo a estrenar. Exterior a calle prudencio, con vistas a la basílica del pilar. Piso sin amueblar de un dormitorio con baño incorporado, salón-cocina completamente equipada. Tanto el salón como el dormitorio tienen balcones exteriores a calle alfonso. La calefaccion es eléctrica por radiadores y tiene ventiladores de techo, suelos de mármol y recién pintado. Grandes ventanales y balcones, muy luminoso. Comunidad incluida en la mensualidad. Sin comision de agencia. Es un sueño levantarte y ver las torres del pilar, situado en la calle alfonso.', 'https://robohash.org/voluptatemeiusrepudiandae.png?size=50x50&set=set1', 'PISO', 625.46, 45, 1, 1, true, false, true, false, 52, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
