insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Piso en VARSÒVIA', 'El Guinardó, Barcelona', 'Apartamento en alquiler de 1 habitación doble, balcón, salón y comedor independiente, muy soleado, baño reformado, cocina. Finca sin ascensor (4º). OBSERVACIONES: Alquiler de 4 a 11 meses. Precio mensual de alquiler 900€. Están incluidos en el precio los gastos de la comunidad, el seguro y el IBI. No están incluidos los honorarios de la agencia, ni los consumos de agua y luz.', 'https://robohash.org/voluptatibuserrorillo.png?size=50x50&set=set1', 'PISO', 886.91, 40, 1, 1, false, false, true, false, 10, '99ec6bb0-6c98-593c-812b-86ab4de48361');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa independiente en Bellas Artes', 'Montecanal-Valdespartera-Rosales del Canal, Zaragoza', 'Chalet independiente en Urbanización Montecanal, la mejor Zona Residencial de Zaragoza. Consta de 343 m2 construidos, 305 m2 útiles de vivienda en parcela de 324 m2, distribuidos en 4 PLANTAS, con 3 dormitorios dobles, además de JARDÍN PRIVADO y GARAJE para 3 coches.', 'https://robohash.org/estevenietquas.png?size=50x50&set=set1', 'CASA', 1750.99, 343, 3, 3, false, false, true, true, 52, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Ático en San Vicente Ferrer, 74', 'Malasaña-Universidad, Madrid', 'Soñar Contigo presenta, en exclusiva, esta preciosa y especial estudio-buhardilla en la calle San Vicente Ferrer, en el barrio de Malasaña, una de las zonas más cosmopolitas y modernas de la capital. La buhardilla ha sido saneada, reformada y modernizada por completo, manteniendo a la vista los elementos constructivos que le dan más carácter, como el parche de ladrillo visto o las vigas de madera al aire pintadas en blanco. Nos encontramos ante una vivienda práctica y con una gran personalidad, algo que se nota desde el momento en que entramos por la puerta. La buhardilla ha sido reamueblada por completo para su puesta a la venta, incluyendo electrodomésticos nuevos, y esta totalmente equipada para entrar a vivir, incluyendo textiles de cama y baño, vajilla, electrodomésticos, batería de cocina, Smart TV, plancha, secador, exprimidor y cafetera Nespresso.', 'https://robohash.org/consequunturquiareiciendis.png?size=50x50&set=set1', 'PISO', 900.55, 30, 0, 1, false, false, false, false, 33, 'f87239fd-e902-5cf7-8e9e-4b85bf5d323d');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Casa independiente en avenida Y Paseo Virgen de Consolacion, 7', 'C/ La Hiedra, Jaén', 'Este Adosado está situado en el centro histórico de Castellar. La entrada está en una avenida peatonal con acceso al tráfico rodeado por residentes. La actividad económica gira en torno a la agricultura y en especial a la olivicultura. Su extensión superficial es de 159 km². Si te gusta el conectar con la naturaleza, vivir en un pueblo con una gente cercana y amigable. Podrás disfrutar de su gran gastronomía y sus deliciosos aceites de oliva. Este adosado se compone de 4 plantas. Sin duda una de las joyas Inmobiliarias de Castellar. Pocas propiedades como está podrás encontrar en el pueblo. Destaca por sus materiales de construcciones y perfecta distribución de sus estancias. En la planta principal podrás encontrar 2 salones con chimenea donde poder encender una lumbre en las noches de frío donde reunirte con tu familia o amigos, 1 baño, cocina-comedor con chimenea y balcón con vistas infinitas de olivos y parte sierra morena. En la planta inferior podemos destacar el gran salón con minibar para reuniones y celebraciones. un despensero y salida a la zona de la piscina climatizada y vistas increíbles que da a la parte de atrás en una zona muy tranquila. En la primera planta se encuentran los dormitorios. 1 Dormitorio en Suite y 2 dormitorios más 1 baño. El dormitorio en Suite destaca por su gran amplitud y vistas al interior y exterior de la casa. También dispone de un balcón interior con vistas al salón principal de la planta principal. Los dormitorios sin suite tienen vistas a la piscina, a las montañas de olivos y sierra. En la última planta hay 2 dormitorios de invitados en suite muy amplios. En su arquitectura podemos destacar el diseño abierto y con gran luminosidad ya que el centro de la casa tiene un techo de cristal de gran resistencia que hace que siempre haya luz en toda la vivienda. La parte de la piscina con unas vista infinitas a un inmenso mar de olivos y sierra morena, es de las zonas que se pueden disfrutar tanto en invierno como en verano la tranquilidad de un pueblo muy hospitalario y buena gente, su gastronomía, fiestas y cultura. las ciudades de alrededor con patrimonio de la humanidad, sierra morena y sierra de Cazorla hace de jaén una ciudad con mucho encanto y una gran cultura. El clima mediterráneo hace que puedas tener una propiedad de lujo a un precio increíble.', 'https://robohash.org/delectusdignissimoset.png?size=50x50&set=set1', 'CASA', 1486.43, 400, 6, 5, false, true, true, true, 27, 'ce802e0d-45d6-55ca-90f2-5dc19d03f327');
insert into dwelling (id, name, address, description, image, type, price, m2, num_bedrooms, num_bathrooms, has_elevator, has_pool, has_terrace, has_garage, province_id, user_id) values (NEXTVAL('hibernate_sequence'), 'Chalet pareado en Av de Europa s/n', 'Zona Avenida de Europa, Montequinto', 'Casa adosada de 2 habitaciones, 3 baños, cocina amueblada y dos patios ( uno de ellos con Césped artificial). Totalmente reformada y en muy buen estado. Tiene La cocina totalmente amueblada con todos los electrodomésticos. El resto está sin amueblar (Tal como las fotos) La casa se encuentra dentro de una urbanización, lo que hace que sea muy tranquila y con mucha privacidad. Piscina comunitaria, garaje individual para un vehículo y un trastero en el jardín trasero. Se encuentra en una de las mejores zonas de Montequinto, junto al Parque de los Pinos, supermercados, colegios, farmacias, restaurantes, centros deportivos, etc. Tiene buena comunicación con la parada de metro a unos 900 metros (10 min andando) y parada de autobús cerca La casa se alquila hasta Septiembre de 2024 aproximadamente. 1 mes de fianza, Contrato de trabajo/Renta año 2022, estabilidad financiera. Contactos por mensajes mediante wasap al teléfono indicado (No llamadas).', 'https://robohash.org/sapienteealaboriosam.png?size=50x50&set=set1', 'CHALET', 976.19, 107, 2, 3, false, true, true, true, 43, '3e35d4f4-7716-54b2-9bdf-805ac4f5b6f0');
insert into favourites (user_id, dwelling_id) values ('2bd9e760-a11e-5d8f-9641-1c54e79c57a1', 67)